import React, {useState} from "react";
import "./App.scss";
import { BrowserRouter as Router, Route, NavLink } from "react-router-dom";

function App() {
  const [auth, setauth] = useState(false)
  return (
    <AuthContext value={auth}>
      <Router>
        <div className="App"></div>
      </Router>
    </AuthContext>
  );
}

export default App;
